import React, { useEffect, useState } from "react";
import { retailerAPI, cartAPI } from "../services/api";
import { useParams, useNavigate, Link } from "react-router-dom";
import "./RetailerDashboard.css";

const FarmerProducts = () => {
  const { farmerId } = useParams();
  const [farmer, setFarmer] = useState(null);
  const [quantities, setQuantities] = useState({});
  const navigate = useNavigate();

  useEffect(() => {
    const fetchFarmer = async () => {
      try {
        const response = await retailerAPI.getFarmerById(farmerId);
        setFarmer(response.data);
      } catch (error) {
        console.error("Error fetching farmer:", error);
      }
    };
    fetchFarmer();
  }, [farmerId]);

  const handleQuantityChange = (productId, value) => {
    setQuantities((prev) => ({ ...prev, [productId]: Number(value) }));
  };

  const handleAddToCart = async (productId) => {
    const retailer = JSON.parse(localStorage.getItem("retailer"));
    if (!retailer) {
      alert("Please log in first!");
      navigate("/retailer/login");
      return;
    }
    const quantity = quantities[productId] || 1;
    try {
      await cartAPI.addToCart({ retailerId: retailer.id, productId, quantity });
      alert("‚úÖ Added to cart!");
    } catch {
      alert("‚ùå Failed to add to cart.");
    }
  };

  if (!farmer) return <p className="loading">Loading farmer products...</p>;

  return (
    <div className="dashboard">
      <header className="dashboard-header-bar">
        <div className="logo">{farmer.name}‚Äôs Products üåæ</div>
        <nav className="nav-links">
          <Link to="/retailer/dashboard" className="nav-link">‚¨Ö Back to Farmers</Link>
          <Link to="/retailer/cart" className="nav-link">üõçÔ∏è View Cart</Link>
        </nav>
      </header>

      <section className="dashboard-title-section">
        <h1>{farmer.name}‚Äôs Product List</h1>
        <p>Explore all available produce directly from {farmer.name}.</p>
        <hr className="section-divider" />
      </section>

      {farmer.products && farmer.products.length > 0 ? (
        <table className="product-table">
          <thead>
            <tr>
              <th>Product</th>
              <th>Category</th>
              <th>Price</th>
              <th>Description</th>
              <th>Qty</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {farmer.products.map((p) => (
              <tr key={p.id}>
                <td>{p.name}</td>
                <td>{p.category}</td>
                <td>‚Çπ{p.price}</td>
                <td>{p.description}</td>
                <td>
                  <input
                    type="number"
                    min="1"
                    value={quantities[p.id] || 1}
                    onChange={(e) => handleQuantityChange(p.id, e.target.value)}
                  />
                </td>
                <td>
                  <button
                    onClick={() => handleAddToCart(p.id)}
                    className="add-cart-btn"
                  >
                    üõí Add
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p className="no-products-msg">üö´ No products available.</p>
      )}
    </div>
  );
};

export default FarmerProducts;
